import React from 'react';
import { Container, Row, Col, Dropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import Search from './common/search';
import { Styles } from "./common/styles/header";
const Header = () => {
    return (
        <>
        <Styles>
          <section className="top-bar">
                    <Container>
                        <Row> 
                            <Col lg="6" md="5">
                                <div className="bar-left">
                                    <ul className="list-unstyled list-inline m-0">
                                        <li className="list-inline-item"><i className="las la-map-marker"></i>795 South Park Avenue, CA 94107.</li>
                                        <li className="list-inline-item">Have Questions</li>
                                    </ul>
                                </div>
                            </Col> 
                        </Row>
                    </Container>
                </section>
                </Styles>
        </>
    )
}

export default Header
